import { useMutation } from '@apollo/react-hooks';
import gql from "graphql-tag"
import { Button, Form, Modal } from 'react-bootstrap';
import 'bootstrap/dist/css/bootstrap.min.css';
import { Link, useNavigate } from 'react-router-dom';
import { StrictMode, Alert, useState } from 'react';




const LOGIN_USUARIO = gql`
mutation($correo: String!, $password: String!){
  login(correo: $correo, password: $password) {
    success
    token
    errors {
      message
    }
  }
}
`

function Example() {
    const [show, setShow] = useState(false);
  
    const handleClose = () => setShow(false);
    const handleShow = () => setShow(true);
  
    return (
      <>
        <Button variant="primary" onClick={handleShow}>
          Launch demo modal
        </Button>
  
        <Modal show={show} onHide={handleClose}>
          <Modal.Header closeButton>
            <Modal.Title>Modal heading</Modal.Title>
          </Modal.Header>
          <Modal.Body>Woohoo, you're reading this text in a modal!</Modal.Body>
          <Modal.Footer>
            <Button variant="secondary" onClick={handleClose}>
              Close
            </Button>
            <Button variant="primary" onClick={handleClose}>
              Save Changes
            </Button>
          </Modal.Footer>
        </Modal>
      </>
    );
  }

function AlertDismissibleExample() {
    const [show, setShow] = useState(true);
  
    if (show) {
      return (
        <Alert variant="danger" onClose={() => setShow(false)} dismissible>
          <Alert.Heading>Oh snap! You got an error!</Alert.Heading>
          <p>
            Change this and that and try again. Duis mollis, est non commodo
            luctus, nisi erat porttitor ligula, eget lacinia odio sem nec elit.
            Cras mattis consectetur purus sit amet fermentum.
          </p>
        </Alert>
      );
    }
    return <Button onClick={() => setShow(true)}>Show Alert</Button>;
  }

const Login = ()=>{

    const navigate = useNavigate() 

    const [loginUser,{ data, loading, error }] = useMutation(LOGIN_USUARIO)

    

    

    if (loading) return 'Submitting...';
    if (error) return `Submission error! ${error.message}`;
   
  
   

    return(
        <StrictMode>
      <div className="container d-flex justify-content-center align-items-center" style={{height:"100vh"}}>

        <div style={{width:"30%"}} className="border p-4">
            <Form            
                    
                onSubmit={async e=>{
                    e.preventDefault()   
                    
                    
                    let respuesta = await loginUser({variables:{correo: e.target.correo.value,password:e.target.password.value}})
                    console.log(respuesta.data.login.success)
                    console.log("Correo: " , e.target.correo.value, " Contrase√±a: " , e.target.password.value)
                    if (respuesta.data.login.success) {
                        navigate("/mainview")
                    }else {AlertDismissibleExample()}
    
                }} >
            
                <legend>Login</legend>
            
                <Form.Group className="mb-3" controlId="correo">
                    <Form.Label>Direcci√≥n de correo</Form.Label>
                    <Form.Control type="email" placeholder="ingrese su correo" />
                    <Form.Text className="text-muted">
                        Nunca se compartira su correo
                    </Form.Text>
                </Form.Group>

                

                <Form.Group className="mb-3" controlId="password">
                    <Form.Label>Password</Form.Label>
                    <Form.Control type="password" placeholder="Contrase√±a" />
                </Form.Group>
        
                
                <Button variant="primary" type="submit" >
                    Ingresar
                </Button>

                <Form.Group className="mt-3 d-flex justify-content-end" controlId="registrarse">
                <p>No eres miembro? <Link to="/agregar_usuario">Registrate</Link></p>
                </Form.Group>
                
                
            </Form>
        </div>
        
    
      </div>
      </StrictMode>
    )
  }

  export default Login
